{'authority_id': 'p05hrsf', 'source': 'p05hrsf', 'spatial_coverage_description': 'Algiers', 'editorial_note': 'The chart depicts years with a chronological line at the top, radiating from a center point of the birth of Christ. "BC" has been added to the entries where required as illustrated by the structure of the chart, but not actually written.
Spatial coverage has been determined by the labels on the chart running along the right side, separated across the chart with horizontal lines, and narrowed within each horizontal line by smaller areas.

In this case, spatial coverage is determined by the reference to Numidians on one side of this bar and to Algiers on the other.', 'spatial_coverage_uris': ['http://www.wikidata.org/entity/Q262']}

{'authority_id': 'p05hrsf', 'source': 'p05hrsf', 'spatial_coverage_description': 'Tunis and Tripoli', 'editorial_note': 'The chart depicts years with a chronological line at the top, radiating from a center point of the birth of Christ. "BC" has been added to the entries where required as illustrated by the structure of the chart, but not actually written.
Spatial coverage has been determined by the labels on the chart running along the right side, separated across the chart with horizontal lines, and narrowed within each horizontal line by smaller areas.

The start date seems to be indicated by the end of the Carthaginian period, which Priestley would have recognized as 146 BC, and in fact the chart suggests a point between 150 and 140 BC.', 'spatial_coverage_uris': ['http://www.wikidata.org/entity/Q948', 'http://www.wikidata.org/entity/Q1016']}

{'authority_id': 'p0mrv3s', 'source': 'p0mrv3s', 'spatial_coverage_description': 'Pompeii', 'editorial_note': 'This period refers to the chronology of Roman building and translates to "Period I". Mauri derives this periodization from Mau (http://n2t.net/ark:/99152/p03xjrfg8cc), preferring it to Fiorelli's periodization (http://www.worldcat.org/oclc/6411737): "...more complete is the Mau which divided the Pompeian building into main phases: Period I - corresponding to the 6th century BC."  (pages 88-89) 
This period is followed by a second building period, also from Mau (http://n2t.net/ark:/99152/p03xjrf), which does not have explicit dates, but an end around the time of the Second Punic War. (page 89)

 Maiuri provides a disclaimer about Mau's dating of the pre-Samnite and Samnite Periods, offering a more cautious approach to dating based on material: "Even this classification of the Mau is no longer adheres to reality and in the light of new discoveries, especially with regard to the pre-Samnite Period which presents itself with a more complex variety and with materials so far not yet known, such as in soft tufa, first used alone and then together with limestone. Secondly, not all the limestone atrium houses can be considered today to be of the of the Samnite Age." (page 90)', 'spatial_coverage_uris': ['http://www.wikidata.org/entity/Q38']}

{'authority_id': 'p09hq4n', 'source': 'p09hq4n', 'spatial_coverage_description': 'Parts of central continental western Europe', 'editorial_note': "This period is used by the ArkeoGIS and ArkeOpen projects, in the framework of a chronology from the Paleolithic to the present day, of a central-western part of continental Europe. The territory covered by this chronology extends from the eastern part of France in the west to Moldavia in the east, and from the south of the UK through southern Germany to Slovenia and central France on a north/south axis. It is based on the periodization set up by INRAP and PACTOLS and on the books:

Cette période est utilisée par les projets ArkeoGIS et ArkeOpen, dans le cadre d'une chronologie du Paléolithique à nos jours, d'une partie centrale-occidentale de l'Europe continentale. Le territoire recouvert par cette chronologie s'étend de la partie orientale de la France, à l'ouest, jusqu'à la Moldavie à l'est, et du sud du Royaume-Uni en passant par l'Allemagne méridionale jusqu'à la Slovénie et le centre de la France sur un axe nord/sud. Elle se fonde sur la périodisation mise en place par l'INRAP et PACTOLS et sur les ouvrages :

- Milcent, Pierre-Yves. Le Premier Âge Du Fer En France Centrale. 2 vol. Mémoire, XXXIV. Paris: Société préhistorique française, 2004.", 'spatial_coverage_uris': ['http://www.wikidata.org/entity/Q142', 'http://www.wikidata.org/entity/Q183', 'http://www.wikidata.org/entity/Q21', 'http://www.wikidata.org/entity/Q31', 'http://www.wikidata.org/entity/Q55', 'http://www.wikidata.org/entity/Q39', 'http://www.wikidata.org/entity/Q40', 'http://www.wikidata.org/entity/Q213', 'http://www.wikidata.org/entity/Q214', 'http://www.wikidata.org/entity/Q36', 'http://www.wikidata.org/entity/Q212', 'http://www.wikidata.org/entity/Q218', 'http://www.wikidata.org/entity/Q28', 'http://www.wikidata.org/entity/Q38']}

