- Barral, Philippe, et Stephan Fichtl, éd. Regards sur la chronologie de la fin de l’âge du Fer (IIIe - Ier siècle avant J.-C.) en Gaule non méditerranéenne : actes de la table ronde tenue à Bibracte, Glux-en-Glenne, 15 - 17 octobre 2007 ; Table Ronde sur la Chronologie de la Fin de l’âge du Fer dans l’Est de la France. Collection Bibracte 22. Glux-en-Glenne: Bibracte, Centre Archéologique Européen, 2012.", 'spatial_coverage_uris': ['http://www.wikidata.org/entity/Q142', 'http://www.wikidata.org/entity/Q183', 'http://www.wikidata.org/entity/Q21', 'http://www.wikidata.org/entity/Q31', 'http://www.wikidata.org/entity/Q55', 'http://www.wikidata.org/entity/Q39', 'http://www.wikidata.org/entity/Q40', 'http://www.wikidata.org/entity/Q213', 'http://www.wikidata.org/entity/Q214', 'http://www.wikidata.org/entity/Q36', 'http://www.wikidata.org/entity/Q212', 'http://www.wikidata.org/entity/Q218', 'http://www.wikidata.org/entity/Q28', 'http://www.wikidata.org/entity/Q38']}

